			"article" : "<p><span style=\"color: #222222; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19px; background-color: #ffffff;\">Meteor is really an awesome tool to build great Web apps and get productive fast. I absolutely love it. That&rsquo;s why 6 months ago I created a package that allows you to plug Webpack with Meteor. I though if we could add a real-time hot reload, ES6 modules, bundle assets with the code and do code splitting, it would make Meteor 2x cooler and it did.</span></p>",
