			"article" : "<p><span style=\"color: #222222; font-family: Helvetica, Arial, sans-serif; font-size: 14px; line-height: 19px; background-color: #ffffff;\">Today I am releasing a complete new version of webpack:webpack. Webpack configs are now gone! You can setup Webpack features simply by adding packages and tweak the settings with a JSON file. It&rsquo;s seriously easy. FYI it's already 100% compatible with Meteor 1.3</span></p>",
